import supertest from "supertest";
const request = supertest("https://gorest.co.in/public/v2/");
import { expect } from "chai";

const token =
  "c43fa51cdc74eab690399b7a7729bd886fd9da9f5a4de4d6eb0837a14d8ce61a";
let id;
describe("Users", () => {
  it("Post/User", () => {
    const data = {
      email: `test-${Math.floor(Math.random() * 99999)}@gmail.com`,
      name: "Mustapha",
      gender: "male",
      status: "inactive",
    };
    return request
      .post("users")
      .set("Authorization", `Bearer ${token}`)
      .send(data)
      .then((res) => {
        console.log(res);
        expect(res.body).to.deep.include(data);
        id = res.body.id;
      });
  });
  it("Get/Users", () => {
    return request.get(`users?access-token=${token}`).then((res) => {
      expect(res.body).to.not.be.empty;
    });
  });
  it("Get/Users/:id", () => {
    return request.get(`users/${id}?access-token=${token}`).then((res) => {
      console.log(res.body);
      expect(res.body.status).to.be.deep.equal("inactive");
      expect(res.body.email).to.not.be.empty;
    });
  });
  it("Put/Users", () => {
    return request
      .put(`users/${id}`)
      .set("Authorization", `Bearer ${token}`)
      .send({ status: "Active" })
      .then((res) => {
        expect(res.body.status).to.be.deep.equal("active");
      });
  });
  it("Delete/Users", () => {
    return request
      .delete(`users/${id}`)
      .set("Authorization", `Bearer ${token}`)
      .send()
      .then((res) => {
        expect(res.statusCode).to.be.equal(204);
      });
  });
});

